text:
Thank you so incredibly much for this wonderful Vocal & Piano Cover DAHYUN!!! Your magnificent vocals with your stunning piano playing form a captivating cover that touches my heart deeply!!! Thank you for preparing another beautiful cover, DAHYUN!!! I'll watch and listen to it happily  forever!!! Thank you so incredibly much!!! You sing the gorgeous lyrics marvelously and you play the melody and chords perfectly!!! It's a perfect cover, DAHYUN!!! Let's have a happy and healthy new year together TWICE and we ONCE!!! Every year of my life is filled with TWICE always!!! Let's be together happily, healthily, strongly, safely, perfectly forever TWICE and we ONCE!!! I love you, DAHYUN, and All Other TWICE Members so incredibly much always!!! 
